import gql from 'graphql-tag';

//Query para el discograf

export const songs_query = gql ` query {
    getSongs {
        id
        filename
        duracion
        originalname
    }
}`

export const song_query = gql ` query {
    getSong(id:"5df9a62f11a415166094b88f"){
        id
        songname
        source
        artname
    }
}`
